sys_variable_value.value:
(function execute(inputs, outputs) {
    if(inputs.status_code =='200'){
        var responseBody =  JSON.parse(inputs.response);
        outputs.bairro = responseBody.bairro
        outputs.estado = responseBody.uf
        outputs.rua = responseBody.logradouro
        outputs.cidade = responseBody.localidade
    }


})(inputs, outputs);

